import { Box } from '@mui/material';
import React from 'react';
import CombinedComponent from './CombinedC'; // Importing the merged component
import { Link } from 'react-router-dom';
import { Button } from '@mui/material';

function BookNow() {
    return (
        <Box
            sx={{
                minHeight: '100vh',
                backgroundColor: 'white',
                padding: '15px 30px',
            }}
        >
            {/* Header Section */}
            <Box
                sx={{
                    marginBottom: '20px',
                    backgroundColor: 'red',
                    color: 'white',
                    padding: '1px',
                    borderRadius: '8px',
                }}
            >
                <div style={{ textAlign: 'center', marginTop: '20px' }}>
                    <h1>E-Just Hotel Guest House</h1>
                </div>
            </Box>

            {/* CombinedComponent */}
            <CombinedComponent />

            {/* Link button to facilities booking */}
            <Box>
                <Link to="/Bookservices">
                    <Button
                        variant="contained"
                        sx={{
                            position: 'absolute',
                            top: 790,
                            right: 80,
                            width: '42%',
                            height: '30vh',
                            margin: '0px',
                            backgroundColor: 'grey',
                            color: 'white',
                            padding: '25px 20px',
                            fontSize: '18px',
                        }}
                    >
                        <h1>Book Your activities/services</h1>
                    </Button>
                </Link>
            </Box>
        </Box>
    );
}

export default BookNow;
